// React
import React, { Fragment } from "react";

// Third pard
import { Row, Col, Form, Input, Button, Typography } from "antd";

// custom
import "../../assets/css/LoginForm.css";
import { openNotification } from "../components/common/notification";

// services
import { login } from "../../services/userServices";

const { Title } = Typography;

const layout = {
  labelCol: {
    span: 8
  },
  wrapperCol: {
    span: 16
  }
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16
  }
};

const SignIn = ({ history }) => {
  const onhandleAdd = async values => {
    try {
      await login(values, history);
    } catch (error) {
      console.log("Error");
    }
  };

  const onFinishFailed = errorInfo => {
    openNotification("error", "user", "notuser");
  };

  return (
    <Fragment>
      <Row>
        <Col xs={10} xl={10} md={10}>
          <div>
            <img
              alt="restaurant"
              style={{ width: "100%" }}
              src="https://images.unsplash.com/photo-1537047902294-62a40c20a6ae?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1275&q=80"
            />
          </div>
        </Col>
        <Col xs={{ span: 10 }} xl={{ span: 10 }}>
          <Form
            {...layout}
            name="loginForm"
            onFinish={onhandleAdd}
            onFinishFailed={onFinishFailed}
            className="form"
          >
            <Col xs={{ span: 20 }} xl={{ span: 20, offset: 8 }}>
              <Title>Welcome Restaurant</Title>
            </Col>

            <Form.Item
              label="Email"
              name="email"
              rules={[
                {
                  required: true,
                  type: "email",
                  message: "Please input your Email!"
                }
              ]}
            >
              <Input />
            </Form.Item>

            <Form.Item
              label="Password"
              name="password"
              rules={[
                {
                  required: true,
                  message: "Please input your password!"
                }
              ]}
            >
              <Input.Password />
            </Form.Item>

            <Form.Item {...tailLayout}>
              <Button type="primary" htmlType="submit">
                Submit
              </Button>
            </Form.Item>
          </Form>
        </Col>
      </Row>
    </Fragment>
  );
};

export default SignIn;
